"      </div>",
"     </div>",
"    </div>",
"   </div>",
"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Campylobacter infection (The Basics)",
"    </div>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H7929152\">",
"      <span class=\"h1\">",
"       What is a Campylobacter infection?",
"      </span>",
"      &nbsp;&mdash;&nbsp;A Campylobacter infection is an infection that causes sudden diarrhea, stomach cramping, and pain in the area around the belly button. It is caused by a type of bacteria called Campylobacter.",
"     </p>",
"     <p>",
"      Campylobacter bacteria are often found in chicken, turkey, and other types of poultry. These bacteria are also found in other types of meat. Most often, people get infected with campylobacter when they:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Eat undercooked chicken or other meats",
"       </li>",
"       <li>",
"        Eat foods that were prepared using knives, cutting boards, or other kitchen tools that were used on raw chicken or meat and were not washed",
"       </li>",
"       <li>",
"        Drink milk that is not pasteurized or eat foods made with milk that is not pasteurized",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H7929167\">",
"      <span class=\"h1\">",
"       What are the symptoms of a Campylobacter infection?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The symptoms include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Diarrhea that comes on suddenly (and can be bloody)",
"       </li>",
"       <li>",
"        Stomach cramps",
"       </li>",
"       <li>",
"        Pain in the area around the belly button (sometimes spreading to the right side of the belly)",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      For about a day before the above symptoms start, a third of those with a Campylobacter infection also get:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        High fever",
"       </li>",
"       <li>",
"        Shaking",
"       </li>",
"       <li>",
"        Body aches",
"       </li>",
"       <li>",
"        Dizziness",
"       </li>",
"       <li>",
"        Confusion",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Diarrhea caused by Campylobacter usually lasts about a week and then goes away on its own. Belly pain sometimes continues even after diarrhea goes away.",
"     </p>",
"     <p>",
"      In very few cases, some people develop pain in their ankles, knees, or other joints after having a Campylobacter infection. This pain usually goes away on its own.",
"     </p>",
"     <p>",
"      In children, the symptoms of Campylobacter infection can be more severe. Children can have the same symptoms listed above, but they can also have vomiting and a higher fever. In children, the fever can even lead to seizures.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H7929182\">",
"      <span class=\"h1\">",
"       Should I see a doctor or nurse?",
"      </span>",
"      &nbsp;&mdash;&nbsp;See your doctor or nurse if you:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Have severe belly pain",
"       </li>",
"       <li>",
"        Cannot eat or drink",
"       </li>",
"       <li>",
"        Vomit blood or have blood in your bowel movements",
"       </li>",
"       <li>",
"        Have a fever higher than 100.4&deg;F (38&deg;C)",
"       </li>",
"       <li>",
"        Have diarrhea that lasts more than a week",
"       </li>",
"       <li>",
"        Have any medical problem that makes it hard for you to fight infection (such as cancer or AIDS) or you take medicines to suppress your immune system",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Young children and older adults with symptoms should make sure to see their doctor or nurse. That&rsquo;s because people in these groups can get dehydrated more easily.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H7929197\">",
"      <span class=\"h1\">",
"       Will I need tests?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Probably not, but your doctor might do a test on a sample of bowel movement to check what type of infection you have.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H7929212\">",
"      <span class=\"h1\">",
"       How is Campylobacter infection treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Treatment is not usually needed. Most people get better without treatment.",
"     </p>",
"     <p>",
"      People who are very sick or who do not get better after a week can get antibiotics to fight the infection.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H7929227\">",
"      <span class=\"h1\">",
"       Is there anything I can do on my own to feel better?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. You can:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Drink enough liquids so that your body does not get &ldquo;dehydrated.&rdquo; Dehydration is when the body loses too much water.",
"       </li>",
"       <li>",
"        Eat small meals that do not have a lot of fat in them",
"       </li>",
"       <li>",
"        Rest, if you feel tired",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <strong>",
"       Can Campylobacter infection be prevented?",
"      </strong>",
"      &mdash; To reduce your chance of getting (or spreading) a Campylobacter infection and other types of food poisoning:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Wash your hands after changing diapers, going to the bathroom, blowing your nose, touching animals, or taking out the trash",
"       </li>",
"       <li>",
"        Stay home from work or school until you feel better (if you are sick)",
"       </li>",
"       <li>",
"        Pay attention to food safety. Tips include:",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"hyphen-block\">",
"       <li>",
"        Do not drink unpasteurized milk or foods made with it",
"       </li>",
"       <li>",
"        Wash fruits and vegetables well before eating them",
"       </li>",
"       <li>",
"        Keep the refrigerator colder than 40&deg;F (4.4&deg;C) and the freezer below 0&deg;F (-18&deg;C)",
"       </li>",
"       <li>",
"        Cook meat and seafood until well done",
"       </li>",
"       <li>",
"        Cook eggs until the yolk is firm",
"       </li>",
"       <li>",
"        Always wash your hands, knives, and cutting boards after they touch raw food",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      For more food safety tips to prevent food poisoning, see the Table (",
"      <a class=\"graphic graphic_table graphicRef60529 \" href=\"UTD.htm?0/34/557\">",
"       table 1",
"      </a>",
"      ).",
"     </p>",
"     <p>",
"      Pregnant women and people who have trouble fighting infection can do more things to prevent getting food poisoning. If you are pregnant or have trouble fighting off infections, talk to your doctor or nurse about other ways to prevent getting food poisoning.",
"     </p>",
