var title_f2_42_2727="Iliac aneurysm symptoms";
var content_f2_42_2727=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=SURG%2F50540&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=SURG%2F50540&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 555px\">",
"   <div class=\"ttl\">",
"    Iliac aneurysm symptoms",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 535px; height: 585px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Iliac artery aneurysms behave similar to abdominal aortic aneurysms with symptoms related to aneurysm expansion including pain from arterial wall stretching, or compression and erosion of surrounding structures. Compressive symptoms of iliac artery aneurysm can involve the lower urinary tract (eg, ureteric colic, ureteral obstruction, pyelonephritis, urinary retention), lower gastrointestinal tract (eg, pain with defecation, tenesmus and constipation), or lumbar/pelvic nerves (paresthesia, sciatic neuralgia).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
