var title_f2_42_2728="Nasogastric tube placement";
var content_f2_42_2728=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=SURG%2F76398&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=SURG%2F76398&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 520px\">",
"   <div class=\"ttl\">",
"    Nasogastric tube placement",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 500px; height: 581px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    (A) Lubricate the nasogastric (NG) tube and offer the patient a cup or glass of water with a straw (unless contraindicated). Place the tube into one of the nares, gently advance the tube but stop before it reaches the nasopharynx. Direct the patient to sip and swallow as the tube is advanced which helps pass the tube into the esophagus. If water is not being used, ask the patient to swallow.",
"    <br>",
"     (B) Once the tube is in place, aspirate using a suction tip syringe and examine the aspirate. It should have a typical gastric fluid appearance (grassy green, clear and colorless with mucus shreds, or brown). If needed, place a small amount on the pH test strip; the pH should be &le;5.0. Alternatively, instill about 15-20 cc warm water and then aspirate. If the tube is in good position, at least 1/2 of the fluid should be returned.",
"     <br>",
"      (C) Secure the NG tube to the patient's nose with hypoallergenic tape (or an NG tube holder). If the patient's skin is oily, wipe the bridge of the nose with an alcohol pad and allow to dry. Split one end of the tape up the center about 1 1/2 inches. Make tabs on the split ends (by folding the sticky sides together). Apply the unsplit tape end on the patient's nose so the split in the tape starts about 1/2 to 1 1/2 inches from the tip of the nose. Crisscross the tabbed ends around the tube. Apply another piece of tape over the bridge of the nose to secure the tube.",
"      <div class=\"footnotes\">",
"      </div>",
"      <div class=\"reference\">",
"       Reproduced with permission from: Springhouse. Lippincott's Visual Encyclopedia of Clinical Skills. Philadelphia: Wolters Kluwer Health, 2009. Copyright &copy; 2009 Lippincott Williams &amp; Wilkins.",
"      </div>",
"     </br>",
"    </br>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
