"       </td>",
"       <td>",
"        2.1 - 5.0",
"       </td>",
"       <td>",
"        5.1 - 10.0",
"       </td>",
"       <td>",
"        &gt;10",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Negative likelihood ratio",
"       </td>",
"       <td>",
"        0.5 - 0.2",
"       </td>",
"       <td>",
"        0.19 - 0.1",
"       </td>",
"       <td>",
"        &lt;0.1",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
