var title_f2_42_2733="Antiepileptic drugs in children part I";
var content_f2_42_2733=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F68462&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F68462&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Drug therapy for seizures in children",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\" rowspan=\"2\">",
"        Drug",
"       </td>",
"       <td class=\"subtitle1\" colspan=\"2\">",
"        Dose",
"       </td>",
"       <td class=\"subtitle1\" rowspan=\"2\">",
"        Blood level",
"       </td>",
"       <td class=\"subtitle1\" rowspan=\"2\">",
"        Laboratory",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2\">",
"        Starting",
"       </td>",
"       <td class=\"subtitle2\">",
"        Maintenance",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Carbamazepine",
"       </td>",
"       <td>",
"        10-20 mg/kg/day",
"       </td>",
"       <td>",
"        10-35 mg/kg/day",
"       </td>",
"       <td>",
"        4-12 mcg/mL",
"       </td>",
"       <td>",
"        CBC after initial 4-6 weeks, then prn. If initial WBC low (particularly AMC) repeat as needed",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"2\">",
"        Clobazam&nbsp;",
"       </td>",
"       <td>",
"        Children &lt;2 y.o. 0.5-1 mg/kg/day&nbsp;",
"       </td>",
"       <td rowspan=\"2\">",
"        0.5-1 mg/kg/day (max 40 mg/day)&nbsp;",
"       </td>",
"       <td rowspan=\"2\">",
"        Not established&nbsp;",
"       </td>",
"       <td rowspan=\"2\">",
"        Routine lab tests not recommended&nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Children 2-16 y.o. 5 mg/day&nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Clonazepam",
"       </td>",
"       <td>",
"        0.01-0.03 mg/kg/day",
"       </td>",
"       <td>",
"        0.1-0.2 mg/kg/day",
"       </td>",
"       <td>",
"        Not used",
"       </td>",
"       <td>",
"        If clinically indicated (bruising, unexplained fevers, etc)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Clorazepate",
"       </td>",
"       <td>",
"        0.3 mg/kg",
"       </td>",
"       <td>",
"        0.5-3.0 mg/kg",
"       </td>",
"       <td>",
"        Not used",
"       </td>",
"       <td>",
"        Not required",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Ethosuximide",
"       </td>",
"       <td>",
"        15&nbsp;mg/kg/day",
"       </td>",
"       <td>",
"        15-40 mg/kg/day",
"       </td>",
"       <td>",
"        40-100 mcg/mL (any increase to 150)",
"       </td>",
"       <td>",
"        CBC/plts after first 1-2 months, prn thereafter",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Felbamate",
"       </td>",
"       <td>",
"        15 mg/kg/day",
"       </td>",
"       <td>",
"        15-45 mg/kg/day",
"       </td>",
"       <td>",
"        50-100 mcg/mL",
"       </td>",
"       <td>",
"        CBC/plts every 2-4 weeks, hepatic function tests every month",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Gabapentin",
"       </td>",
"       <td>",
"        10-15 mg/kg/day",
"       </td>",
"       <td>",
"        40-50 mg/kg/day",
"       </td>",
"       <td>",
"        Not established (probably 7-12 mcg/mL)",
"       </td>",
"       <td>",
"        CBC/plts every 3 months for first 6 months, chemical panel prn (routine monitoring may not be necessary)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"3\">",
"        Lamotrigine+&nbsp;",
"       </td>",
"       <td>",
"        Monotherapy 0.3 mg/kg/day&nbsp;",
"       </td>",
"       <td>",
"        &nbsp;4.5-7.5 mg/kg/day",
"       </td>",
"       <td rowspan=\"3\">",
"        4-15 mcg/mL",
"       </td>",
"       <td rowspan=\"3\">",
"        CBC/plts every 3 months for first 6 months, chemical panel prn (routine monitoring may not be necessary)&nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Add to VPA 0.15 mg/kg/day&nbsp;",
"       </td>",
"       <td>",
"        &nbsp;1-5 mg/kg/day",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Add to inducer (PB, CBZ, PHT) 0.6 mg/kg/day&nbsp;",
"       </td>",
"       <td>",
"        &nbsp;5-15 mg/kg/day",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Levetiracetam&nbsp;",
"       </td>",
"       <td>",
"        20 mg/kg/day&nbsp;",
"       </td>",
"       <td>",
"        40-60 mg/kg/day&nbsp;",
"       </td>",
"       <td>",
"        Not established&nbsp;",
"       </td>",
"       <td>",
"        Routine lab tests not recommended&nbsp;",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     +: dosing for children 2-12 years of age; AMC: absolute monocyte count; CBC: complete blood count; CBZ: carbamezepine; max: maximum; PB: phenobarbital; PHT: phenytoin; plts: platelets; VPA: valproate; y.o.: years old",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
