"   <div class=\"lgnd\">",
"    Lower esophageal sphincter pressure (top panel) and reflux parameters, number of episodes per hour and percent time that esophageal ph was below 4.0 (middle and lower panels) in patients with asthma and control subjects. Compared to controls, asthmatics had significantly decreased lower esophageal sphincter pressure, more frequent reflux episodes, and higher esophageal acid contact times.",
"    <div class=\"footnotes\">",
